import axios from "axios";
import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function AddSsd() {
  let navigate = useNavigate();

  const [ssd, setSsd] = useState({
    brand: "",
    model: "",
    serialNumber: "",
    size: "",
    purchasePrice: "",
    purchaseDate: "",
    saleValue: "",
    arrivalDate: "",
  });

  const [category, setCategory] = useState({
    productCategory: "",
  });

  const {
    brand,
    model,
    serialNumber,
    size,
    purchasePrice,
    purchaseDate,
    saleValue,
    arrivalDate,
  } = ssd;

  const onInputChange = (e) => {
    setSsd({ ...ssd, [e.target.brand]: e.target.value });
  };
  const onsubmit = async (e) => {
    e.preventDefault();
    await axios.post("http://localhost:9090/ssd/post", ssd);
    navigate("/");
  };

  return (
      <div className="meuForm">
            <form onSubmit={(e) => onSubmit(e)}>

        <div className="form-row">
          <div className="col-md-6 offset-md-3">
            <label className="form-label">Imagem JPEG ou JPG</label>

            <input
              type="file"
              name="file"
              className="form-control"
              placeholder="Brand"
              //   value={file}
              onChange={(e) => onInputChange(e)}
              accept="application/jpg"
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="brand"
              value={brand}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Brand"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="model"
              className="form-control"
              value={model}
              onChange={(e) => onInputChange(e)}
              placeholder="Model"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="serialNumber"
              value={serialNumber}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Serial number"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="size"
              value={size}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Size"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="purchasePrice"
              value={purchasePrice}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Purchase price"
            />
          </div>
          <div className=" col-md-6 offset-md-3">
            <input
              type={"text"}
              name="saleValue"
              value={saleValue}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Sale value"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="purchaseDate"
              value={purchaseDate}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Purchate date"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="arrivalDate"
              value={arrivalDate}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Arrival date"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="productCategory"
              //   value={productCategory}
              onChange={(e) => onInputChange(e)}
              className="form-control"
              placeholder="Category"
            />
          </div>

          <div className="botao">
            <input
              type="button"
              className="btn btn-success"
              value="Cadastrar"
            />
          </div>
        </div>

        </form>
      </div>
  );
}
